import React from 'react';
import './data.css';
import { useHistory } from 'react-router-dom';
import {Box, TextField, Button, CloseIcon} from '@mui/material';


export default function Data() {
  let history = useHistory();
    const submit = () => {
        history.push("/preview");
    }

  return (
    <>
    <div className="data">
      <div className = "mdata"> 
          <h1>My Fitness Tracker</h1>
          <div> 
            <Box
      component="form"
      sx={{
        '& .MuiTextField-root': { m: 1, width: '25ch' },
      }}
      noValidate
      autoComplete="off"
    >
          <TextField required id="outlined-basic" label="Exercise Name" variant="outlined" />
          <TextField required id="outlined-basic" label="Sets" variant="outlined" />
          </Box>
          </div>

          <div>
            <Box
      component="form"
      sx={{
        '& .MuiTextField-root': { m: 1, width: '25ch' },
      }}
      noValidate
      autoComplete="off"
    >
            <TextField required id="outlined-basic" label="Reps" variant="outlined" />
            <TextField required id="outlined-basic" label="Unit" variant="outlined" />
            </Box>
            </div>

            <div>
            <Box
      component="form"
      sx={{
        '& .MuiTextField-root': { m: 1, width: '25ch' },
        
      }}
      noValidate
      autoComplete="off"
    >
              <TextField required id="outlined-basic"  label="Date" variant="outlined" />
              </Box>
              </div>
              <div>
                
                <Button variant="contained" onClick = {submit({
                  vertical:'top',
                  horizontal:'center',

                })
              }>Submit</Button>
                
                    
                  </div>
              
      </div>
          
        </div>
        
    </>
  )
}
